    /**
     * Show all the invalid properties with reasons.
     *
     * @return array invalid properties with reasons
     */
    public function listInvalidProperties()
    {
        $invalidProperties = [];

        if (!is_null($this->container['adult_count']) && ($this->container['adult_count'] < 1)) {
            $invalidProperties[] = "invalid value for 'adult_count', must be bigger than or equal to 1.";
        }

        if (!is_null($this->container['child_count']) && ($this->container['child_count'] < 0)) {
            $invalidProperties[] = "invalid value for 'child_count', must be bigger than or equal to 0.";
        }

        if ($this->container['currency_code'] === null) {
            $invalidProperties[] = "'currency_code' can't be null";
        }
        if ($this->container['language_code'] === null) {
            $invalidProperties[] = "'language_code' can't be null";
        }
        $allowedValues = $this->getUnitSystemAllowableValues();
        if (!is_null($this->container['unit_system']) && !in_array($this->container['unit_system'], $allowedValues, true)) {
            $invalidProperties[] = sprintf(
                "invalid value '%s' for 'unit_system', must be one of '%s'",
                $this->container['unit_system'],
                implode("', '", $allowedValues)
            );
        }

        if (!is_null($this->container['min_length_of_stay']) && ($this->container['min_length_of_stay'] > 30)) {
            $invalidProperties[] = "invalid value for 'min_length_of_stay', must be smaller than or equal to 30.";
        }

        if (!is_null($this->container['min_length_of_stay']) && ($this->container['min_length_of_stay'] < 1)) {
            $invalidProperties[] = "invalid value for 'min_length_of_stay', must be bigger than or equal to 1.";
        }

        if (!is_null($this->container['max_length_of_stay']) && ($this->container['max_length_of_stay'] > 30)) {
            $invalidProperties[] = "invalid value for 'max_length_of_stay', must be smaller than or equal to 30.";
        }

        if (!is_null($this->container['max_length_of_stay']) && ($this->container['max_length_of_stay'] < 1)) {
            $invalidProperties[] = "invalid value for 'max_length_of_stay', must be bigger than or equal to 1.";
        }

        $allowedValues = $this->getSortAllowableValues();
        if (!is_null($this->container['sort']) && !in_array($this->container['sort'], $allowedValues, true)) {
            $invalidProperties[] = sprintf(
                "invalid value '%s' for 'sort', must be one of '%s'",
                $this->container['sort'],
                implode("', '", $allowedValues)
            );
        }

        return $invalidProperties;
    }

